import React, { useState, useRef } from "react";
import {
  TextField,
  Box,
  IconButton,
  InputAdornment,
  FormControl,
} from "@mui/material";
import { Visibility, VisibilityOff } from "@mui/icons-material";
import Logo from "../../assets/logo.png";
import { CustomButton, LoginTitle, ForgotPassText } from "./style";
import { useNavigate } from "react-router-dom";

function LoginForm() {
  const [showPassword, setShowPassword] = useState(false);

  const handleClickShowPassword = () => {
    setShowPassword((prevState) => !prevState);
  };

  const navigate = useNavigate();

  const emailRef = useRef(null);

  const passwordRef = useRef(null);

  const handleRedirect = () => {
		debugger;
    const email = emailRef.current.value;
    const password = passwordRef.current.value;
    if (email === "admin@admin.com" && password === "admin") {
      navigate("/dashbaord");
    }
  };

  return (
    <Box
      sx={{
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        padding: "0px 68px",
        minHeight: "100vh",
      }}
    >
      <img src={Logo} />
      <LoginTitle>Login</LoginTitle>

      <form>
        <FormControl variant="standard" className="inputfield">
          <label className="formLable">
            Email Id
            <span>*</span>
          </label>
          <TextField  label="Email" fullWidth variant="filled" ref={emailRef} />
        </FormControl>
        <FormControl variant="standard" className="inputfield">
          <label className="formLable">
            Password
            <span>*</span>
          </label>
          <TextField
            ref={passwordRef}
            variant="filled"
            type={showPassword ? "text" : "password"} 
            fullWidth
            InputProps={{
              endAdornment: (
                <InputAdornment position="end">
                  <IconButton onClick={handleClickShowPassword} edge="end">
                    {showPassword ? <VisibilityOff /> : <Visibility />}
                  </IconButton>
                </InputAdornment>
              ),
            }}
          />
        </FormControl>
        <ForgotPassText>Forget Password ?</ForgotPassText>
        <CustomButton
          type="submit"
          variant="contained"
          fullWidth
          onClick={handleRedirect}
        >
          Login
        </CustomButton>
      </form>
    </Box>
  );
}

export default LoginForm;
